    false,nt"url": null,nt"notes": "Distribution and abundance of waterbirds,
    marine mammals, and other wildlife were surveyed by helicopter in coastal areas
    of upper Cook Inlet 13-14 July 1993, in areas where there is development potential.
     Numerous surveys of wildlife use of Upper Cook Inlet have been conducted during
    spring however, few have been conducted during summer when waterfowl are rearing
    young or molting, and when shorebirds have commenced their southward migrations.
    Upper Cook Inlet contains important habitat resources for many species of migratory
    birds, marine mammals, and other wildlife. Upper Cook Inlet is also an area of extensive
    onshore and offshore oil and gas production, commercial and sport fishing, ocean-going
    transportation, and military activities; and it is a potential area for coal and
    hardrock mining, hydroelectric power generation, and timber harvest. New infrastructures
    may be proposed at any time for new oil and gas finds, and for developing and exporting
    coal, minerals and timber. New infrastructures may be proposed to be located in
    valuable wildlife habitats. These surveys were conducted to identify and gather
    preliminary data on valuable wildlife habitats.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
